"use client";

import { type ColumnDef } from "@tanstack/react-table";

import { ArrowUpDown, Edit } from "lucide-react";

import { Button } from "~/components/ui/button";

import {
  DropdownMenu,
  DropdownMenuContent,
  DropdownMenuItem,
  DropdownMenuLabel,
  DropdownMenuSeparator,
  DropdownMenuTrigger,
} from "~/components/ui/dropdown-menu";
import {
  Sheet,
  SheetContent,
  SheetDescription,
  SheetHeader,
  SheetTitle,
  SheetTrigger,
} from "~/components/ui/sheet";
import {
  AlertDialog,
  AlertDialogAction,
  AlertDialogCancel,
  AlertDialogContent,
  AlertDialogDescription,
  AlertDialogFooter,
  AlertDialogHeader,
  AlertDialogTitle,
  AlertDialogTrigger,
} from "~/components/ui/alert-dialog";

import { deleteCategory } from "~/server/actions/product";
import { toast } from "sonner";

// This type is used to define the shape of our data.
// You can use a Zod schema here if you want.

export type Category = {
  id: string;
  name: string;
  product: {
    id: string;
    name: string;
    description: string | null;
    price: number;
    stock: number | null;
    images: string | null;
    categoryId: string | null;
  }[];
};

export const columns: ColumnDef<Category>[] = [
  {
    accessorKey: "sn",
    header: "SN",
    cell: ({ row }) => {
      return <span>{row.index + 1}</span>;
    },
  },
  {
    accessorKey: "name",
    header: ({ column }) => {
      return (
        <Button
          variant="ghost"
          onClick={() => column.toggleSorting(column.getIsSorted() === "asc")}
        >
          Name
          <ArrowUpDown className="ml-2 h-4 w-4" />
        </Button>
      );
    },
  },
  {
    accessorKey: "product",
    header: "Products",
    cell: ({ row }) => {
      const products = row.original;
      return <span>{products.product.length}</span>;
    },
  },
  {
    id: "actions",
    cell: ({ row }) => {
      const customer = row.original;

      return (
        <DropdownMenu>
          <DropdownMenuTrigger asChild>
            <Button variant="ghost" className="h-8 w-8 p-0">
              <span className="sr-only">Open menu</span>
              <Edit className="h-4 w-4" />
            </Button>
          </DropdownMenuTrigger>
          <DropdownMenuContent align="end">
            <DropdownMenuLabel>Actions</DropdownMenuLabel>
            <DropdownMenuItem
              onClick={() => navigator.clipboard.writeText(customer.id)}
            >
              Copy ID
            </DropdownMenuItem>

            <DropdownMenuSeparator />
            <DropdownMenuItem asChild>
              <Sheet>
                <SheetTrigger
                  className="flex w-full items-center
                justify-start gap-2 rounded
                p-2 text-center text-sm transition 
                duration-200 hover:bg-gray-100 hover:text-orange-400"
                >
                  View Products
                </SheetTrigger>
                <SheetContent>
                  <SheetHeader className="h-full">
                    <SheetTitle>Products</SheetTitle>
                    <SheetDescription className="h-full">
                      {customer.product.length > 0 ? (
                        customer.product.map((product) => (
                          <div
                            key={product.id}
                            className="flex items-center justify-between gap-6 border-b border-gray-200 p-2"
                          >
                            <div>
                              <p className="text-sm font-semibold">
                                {product.name}
                              </p>
                            </div>
                            <div>
                              <p className="text-sm font-semibold">
                                Rs{product.price}
                              </p>
                              <p className="text-xs text-gray-500">
                                Stock: {product.stock}
                              </p>
                            </div>
                          </div>
                        ))
                      ) : (
                        <div className="flex h-full flex-col items-center justify-center text-xl ">
                          <h1>No products</h1>
                          <div className="self-center">
                            <BackgroundEmpty />
                          </div>
                        </div>
                      )}
                    </SheetDescription>
                  </SheetHeader>
                </SheetContent>
              </Sheet>
            </DropdownMenuItem>
            <DropdownMenuItem asChild className="mx-3 my-1 bg-destructive">
              <AlertDialog>
                <AlertDialogTrigger className=" rounded p-2 text-destructive underline-offset-2 hover:underline ">
                  Delete Category
                </AlertDialogTrigger>
                <AlertDialogContent>
                  <AlertDialogHeader>
                    <AlertDialogTitle>
                      Are you absolutely sure?
                    </AlertDialogTitle>
                    <AlertDialogDescription>
                      This action cannot be undone. This will permanently delete
                      the category from our servers.
                    </AlertDialogDescription>
                  </AlertDialogHeader>
                  <AlertDialogFooter>
                    <AlertDialogCancel>Cancel</AlertDialogCancel>
                    <AlertDialogAction
                      onClick={async () => {
                        await deleteCategory(customer.id);
                        window.location.reload();
                        toast.success("Category deleted successfully");
                      }}
                      className="bg-destructive text-white"
                    >
                      Continue
                    </AlertDialogAction>
                  </AlertDialogFooter>
                </AlertDialogContent>
              </AlertDialog>
            </DropdownMenuItem>
          </DropdownMenuContent>
        </DropdownMenu>
      );
    },
  },
];

